import React from "react";
import {NavLink} from "react-router-dom";
import axios from "axios";


function Navbar(){
    async function getInfo() {
        axios.get("https://api.nytimes.com/svc/topstories/v2/us.json?api-key=XxbWXs3gfJ27rp7UpTF648NqcF2Xp39x")
            .then(response =>{
                console.log(response.data);
            }).catch(function (error){
            console.log(error)
        });
    }
    return(
        <div className={"navbar"}>
            <ul className={"menuList"}>
                <li className={"listItem"}><NavLink to={"/blogone"}>Blog One</NavLink></li>
                <li className={"listItem"}><NavLink to={"/blogtwo"}>Blog Two</NavLink></li>
                <li className={"listItem"}><NavLink to={"/blogthree"}>Blog Three</NavLink></li>
                {/*<li className={"listItem"}><NavLink to={"/"}>BlogTwo</NavLink></li>*/}
            </ul>
            <p>{getInfo}</p>
        </div>
    )
}

export default Navbar;
